export default function createInt8TypedArray(length, position, value) {
  if (position >= length) {
    throw RangeError('Position outside range');
  }

  let bufferT = new DataView(new ArrayBuffer(length));
  bufferT.setInt8(position, value);

  return bufferT;
}






